var ons = require('onsenui');
var Ons = require('react-onsenui');

class Main extends React.Component {
    constructor(props) {
        super(props);
      }
    

    handleClick() 
    {
      Ons.notification.alert('Hello world!');
    }
      
    render() {
        return (
        <ROns.Page>
            <ROns.Button onClick={this.handleClick}>Tap me!</ROns.Button>
        </ROns.Page>
        );
    }
}
